28292724911722498','120.592996','31.305438','Bright','2024-11-04 23:21:00',NULL,NULL),('1928299643378389070','五德居(西中市店)','江苏省苏州市姑苏区金阊街道135号(好又多便利超旁)','这家店是逛街无意间遇到，主要卖白切鸡还有蟹壳黄！他们家白切鸡真的堪比广州，骨头不带血，属于刚刚凝固，但是鸡肉真的是超级滑嫩，皮脆！并且有鸡啫喱！搭配的是调味酱油，一点不输葱姜酱，蟹壳黄也可以试试！葱油的就很好吃','1928292724911722498','120.592996','31.305438','Bright','2024-11-04 23:18:00',NULL,NULL),('1928299643378389071','江南雅厨(李公堤店)','江苏省苏州市吴中区金鸡湖街道李公堤三期16幢','苏州的黑珍珠，也是我见过最便宜的黑珍珠，但是口味是真的可以！两次来苏州都要打卡的店，酒酿蒸白鱼，必点，138元，巨大一条，肉嫩，刺少，都是长刺，不会吃鱼的也很友好！搭配酒酿的香味，一个字绝！然后响油鳝糊其实还可以，烫，鲜，甜，但是不太吃甜的话还是慎点，凉菜黑松露素鹅非常惊艳，豆腐皮里面包的菌菇，豆皮有口感，菌菇爽脆，味道咸鲜带一丝甜味，最后甜品一定要试一下鸡头米相关的，鸡头米真的口感很棒，有嚼头！','1928292724932694023','120.694364','31.298785','Bright','2024-11-04 23:12:00',NULL,'https://track-record-file-base.amap.com/987597394d6549c1c293695436e10c9c/3385480C_19C5_4B7C_8C8A_BC02680B77E9_L0_001_1086_816_.jpg,\nhttps://track-record-file-base.amap.com/55817a0914ae8cb66471a8c01c10f77c/E4A5EAA7_56CA_4963_A93B_1D033A2FCC7F_L0_001_810_1080_.jpg'),('1928299643378389072','化州鸡饭店(广州白云店)','广东省广州市白云区松洲街道一楼',NULL,'1928292724911722497','113.223888','23.159398','鸣珂','2024-11-04 23:08:00',NULL,NULL),('1928299643378389073','湛悦湛江鸡饭店(绿景二路店)','广东省佛山市禅城区石湾镇街道绿景二路(金碧花园对面)',NULL,'1928292724911722497','113.13045','23.016519','鸣珂','2024-11-04 23:06:00',NULL,NULL),('1928299643378389074','禅高美食','广东省佛山市禅城区张槎街道罗鄱东街2号','粤西菜，鸡好吃，捞粉好吃','1928292724911722497','113.097405','23.034763','鸣珂','2024-11-04 23:03:00',NULL,'https://track-record-file-base.amap.com/36fa2d70a7972fd63ad242fcea1e7f56/content_media_external_images_media_1000031032_ss_4.jpg,\nhttps://track-record-file-base.amap.com/ed0e13669e0452ae6f5f17f625196791/content_media_external_images_media_1000031031_ss_4.jpg,\nhttps://track-record-file-base.amap.com/2f5acb5a5bacdaf1a17be4be5a0c6cf9/content_media_external_images_media_1000031030_ss_4.jpg,\nhttps://track-record-file-base.amap.com/e44ca0cc451b4a76d5fe89ea85e3f253/content_media_external_images_media_1000031027_ss_4.jpg,\nhttps://track-record-file-base.amap.com/a7674d2c56eb200ca105fef4